import React, { Component } from 'react'
import QrReader from 'react-qr-reader'
import extractEmails from './emailAddress'
import getMobileNumber from './mobileNumber'

class App extends Component {
  state = {
    result: 'No result'
  }

  handleScan = data => {
    if (data) {
      this.setState({
        result: data
      })
    }
  }
  handleError = err => {
    console.error(err)
  }

  render() {
    return (
      <div className=" row bg-dark text-white container-fluid">
        <div className="col-6">
        <QrReader
          delay={300}
          onError={this.handleError}
          onScan={this.handleScan}
          style={{ width: '100%' }}

        />
         </div>
         <div className="col-6">
        <p>Phone Number is {getMobileNumber(this.state.result)}</p>
    <p>Email is {extractEmails(this.state.result)}</p>
      </div>
      </div>
    )
  }
}
export default App;
